import { Instagram, Pinterest, Facebook, Twitter } from "@mui/icons-material";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
`;
const Left = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  padding: 20px;
`;

const Logo = styled.h1``;

const Details = styled.p`
  margin: 20px 0px;
`;

const SocialContainer = styled.div`
  display: flex;
`;

const SocialIcon = styled.div``;

const Center = styled.div`
  flex: 1;
`;
const Right = styled.div`
  flex: 1;
`;

const Footer = () => {
  return (
    <Container>
      <Left>
        <Logo>Noirmay</Logo>
        <Details>This is a placeholder text. </Details>
        <SocialContainer>
          <SocialIcon>
            <Instagram />
            <Facebook />
            <Twitter />
            <Pinterest />
          </SocialIcon>
        </SocialContainer>
      </Left>
      <Center>
        <p>&copy; 2022 Noirmay</p>
      </Center>
      <Right></Right>
    </Container>
  );
};

export default Footer;
